scriptlet.script:
var data = reworkACHCComments;

function addNewlines(str) {
    var result = '';
    var n, n1 = 0;
    if (str.length > 65) {
        n = str.lastIndexOf(' ', 65);
        result += str.substring(0, n).trim() + '\\t\\t\\t';
        n1 += n;
        str = str.substring(n1);
        result += str.trim()
    } else
        result = data

    return result;
}

try {
    var ACHCComments = addNewlines(reworkACHCComments)

    scriptletContext.put("ACHCComment", ACHCComments);

    response = "success";

} catch (err) {
    scriptletContext.put("errorMessage", err.message);
    scriptletContext.put("failureFlag", "True");
    response = "failure";
}
scriptletResponse = response
